import logo from './logo.svg';
import './App.css';
import { Route, Router } from 'react-router-dom';
import Home from './Pages/Home';


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<PostList />} />
        <Route path="/posts/:id" element={<PostDetail />} />
        <Route path="/create" element={<CreatePost />} />
      </Routes>
    </Router>
  );
}

export default App;
